import { combineReducers } from 'redux';
import {modal, userAuth, entyties,currentUserState}  
                     from 'reducers/lib/appReducers';

import { reducer as form } from 'redux-form'


export  default combineReducers({
	currentUserState,
	modal,
    userAuth,
    form,
    entyties,

})
